import React, { useState } from "react";
import Link from "next/link";
import { FormGroup, FormControlLabel, Checkbox } from "@material-ui/core";
import {
  Container,
  Text,
  SubHeader,
  Input,
  PrimaryButton,
  SubText,
  Header,
  ActionButton,
  CaptionText,
} from "../styledComponents";
import styled from "styled-components";
import { device } from "../../lib/deviceSize";
import hasLogo from "../../public/static/HAS.png";
import { Dropdown } from "../styledComponents";

const ImgWrapper = styled(Container)`
  flex-direction: column;
  flex: 0.3;
  padding-top: 50px;
  padding-left: 60px;
  padding-right: 10px;

  background-color: ${({ theme }) => theme.btnPrimary};
  min-height: 100%;
  max-height: 100%;
`;
const FormWrapper = styled(Container)`
  flex-direction: column;
  padding-top: 40px;
  padding-left: 60px;
  padding-right: 60px;
  flex: 0.7;
  min-height: 100%;
  max-height: 100%;
`;
const Form = styled.form`
  display: flex;
  flex-direction: column;
  width: 50%;
  flex: 0.72;
  padding-top: 30px;
  padding-bottom: 20px;
  /* background-color: red; */
`;

const CompleteRegister = () => {
  const [state, setState] = React.useState({
    checkedA: false,
    checkedB: false,
  });
  const [country, setCountry] = useState([]);
  const [district, setDistrict] = useState([]);
  const [province, setProvince] = useState([]);

  return (
    <Container
      flex={1}
      row
      customStyles={{ minHeight: "100vh", maxHeight: "100vh" }}
    >
      <FormWrapper>
        <Container flex={false} row center color="transparent">
          <img
            src={hasLogo}
            style={{ width: "50px", height: "50px", marginRight: "10px" }}
          />
          <Text>House-Assist Space</Text>
        </Container>
        <Container flex={1} column center>
          <Form>
            <Header customStyles={{ fontWeight: "400", marginBottom: 5 }}>
              Provide more information
            </Header>

            <fieldset
              style={{
                display: "flex",
                paddingTop: "30px",
                paddingLeft: 0,
                paddingRight: 0,
                paddingBottom: 0,
                border: "none",
                flexDirection: "column",
                marginBottom: 10,
              }}
            >
              <CaptionText customStyles={{ marginBottom: 10 }}>
                Tell us a little more about yourself
              </CaptionText>
              <Input label="FIRST NAME" placeholder="First Name" type="text" />
              <Input label="LAST NAME" placeholder="Last Name" type="text" />
              <Input
                label="PHONE NUMBER"
                placeholder="Phone Number"
                type="tel"
              />
              <Container
                row
                center
                color="transparent"
                customStyles={{ marginBottom: 10 }}
              >
                <CaptionText
                  customStyles={{
                    color: "#323130",
                    fontWeight: "600",
                    marginTop: 20,
                  }}
                >
                  Location
                </CaptionText>
              </Container>
              <Container
                row
                color="transparent"
                customStyles={{ marginBottom: 15 }}
              >
                <Countries country={country} setCountry={setCountry} />
                <Provinces
                  country={country}
                  province={province}
                  setProvince={setProvince}
                />
                <Districts
                  district={district}
                  province={province}
                  setDistrict={setDistrict}
                />
              </Container>
              <CaptionText
                customStyles={{
                  marginBottom: 10,
                  fontSize: 11,
                  color: "#323130",
                }}
              >
                WHY ARE YOU JOINING HOUSE-ASSIST SPACE
              </CaptionText>
              <FormGroup column>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={state.checkedA}
                      onChange={handleChange}
                      name="checkedA"
                      color="#0078D4"
                    />
                  }
                  label="I own a properties i want to manage"
                />
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={state.checkedB}
                      onChange={handleChange}
                      name="checkedB"
                      color="#0078D4"
                    />
                  }
                  label="I want to test and check your platform"
                />
              </FormGroup>
            </fieldset>

            <PrimaryButton
              type="submit"
              customStyles={{ padding: 12, marginTop: 10 }}
            >
              Create your account
            </PrimaryButton>
          </Form>
        </Container>
      </FormWrapper>
      <ImgWrapper />
    </Container>
  );
};

export default CompleteRegister;
